import React, { Fragment, Component } from "react";
import Navbar from "./components/layout/Navbar";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div>
        <Navbar title="GitHub Finder" icon="fab fa-githubmr-3" />
      </div>
    );
  }
}
export default App;
